// DirectMessageByMessageId retrieves a row from 'ms.direct_message' as a DirectMessage.
//
// Generated from index 'direct_message_MessageId_pkey'.
func DirectMessageByMessageId(db XODB, messageId int) (*DirectMessage, error) {
	var err error

	// sql query
	const sqlstr = `SELECT ` +
		`MessageId, RoomKey, UserId, MessageFileId, MessageTypeEnum, Text, Time, PeerReceivedTime, PeerSeenTime, DeliviryStatusEnum ` +
		`FROM ms.direct_message ` +
		`WHERE MessageId = ?`

	// run query
	XOLog(sqlstr, messageId)
	dm := DirectMessage{
		_exists: true,
	}

	err = db.QueryRow(sqlstr, messageId).Scan(&dm.MessageId, &dm.RoomKey, &dm.UserId, &dm.MessageFileId, &dm.MessageTypeEnum, &dm.Text, &dm.Time, &dm.PeerReceivedTime, &dm.PeerSeenTime, &dm.DeliviryStatusEnum)
	if err != nil {
		XOLogErr(err)
		return nil, err
	}

	OnDirectMessage_LoadOne(&dm)

	return &dm, nil
}
